answer_a:
To display PDF files and images stored in S3 and not accessible publicly, you can follow these steps:

1. Install the necessary dependencies:
```bash
npm install react-bootstrap bootstrap axios
```
1. Create a function to download the files from S3:
```javascript
import axios from 'axios';

const downloadFileFromS3 = async (bucketName, key) => {
  const response = await axios.get(`https://s3.amazonaws.com/${bucketName}/${key}`);
  return response.data;
};
```
1. Create a state to store the downloaded files:
```javascript
const [downloadedFiles, setDownloadedFiles] = useState([]);
```
1. Create a function to fetch the files from S3 and download them:
```javascript
const fetchAndDownloadFiles = async () => {
  const bucketName = 'your-bucket-name'; // Replace with your S3 bucket name
  const keys = ['key1', 'key2', 'key3']; // Replace with your S3 keys

  const downloadedFilesList = keys.map((key) => {
    const file = downloadFileFromS3(bucketName, key);
    return {
      name: key,
      type: file.type,
      data: file,
    };
  });

  setDownloadedFiles(downloadedFilesList);
};
```
1. Create a component to display the files:
```javascript
const FileDisplay = () => {
  const files = downloadedFiles;

  return (
    <div>
      <h2>Files</h2>
      <div>
        {files.map((file) => (
          <div key={file.name}>
            <img src={file.data} alt={file.name} />
          </div>
        ))}
      </div>
    </div>
  );
};
```
1. Call the `fetchAndDownloadFiles` function when your app starts:
```javascript
useEffect(() => {
  fetchAndDownloadFiles();
}, []);
```
1. Display the `FileDisplay` component in your app:
```javascript
<FileDisplay />
```
This will fetch the files from S3

